import './App.css';
import SquareComponent from './SquareComponent';

function App() {
  return (
    <div className="app-header">
      <p className="heading-text">Tic Tac Toe Game</p>
      <div className="row jc-center"><SquareComponent /></div>
      <div className="row jc-center">X</div>
      <div className="row jc-center">X</div>

    </div>
  );
}

export default App;
